Such fond memories creating this and working with these two absolute icons!! 

I’m not blowing our own trumpet, but it’s very rare to have a wedding that literally goes perfectly! Don’t get me wrong all our weddings are perfect but there could be one thing that’s doesn’t work well, like the weather or a naughty guest - however this wedding just went flawlessly from start to finish in every single way!! The couple, their family’s, the guests, the suppliers …it all melded together, like love!!

The teams involved were just the perfect fit for this, and everyone was such a joy to work with!! 

I’m going to post more on this as we have sooo much to share, and @hollyclarkphotography is a genius for capturing all the beauty!!

It’s amazing to work with not only beautiful people inside and out, but becoming friends with them too - that’s what it’s all about, connections are key!!

Love you all xx

