it’s a pretty cool thing to be able to say, “this is my job.”

the thrill of styling—finding that perfect balance of color. a dance between timeless neutrals and bold, vibrant pops. billie justice’s playful illustrations set against soft, romantic drapes and pearlescent touches. these are the details that make a dear leone experience.

because it’s never just about how a space looks—it’s about how it feels.

b & b’s energy filled the room, and every guest walked away saying, “that was so them.”

i’ve never really thought of myself as an overly creative person, let alone having a business as my full time career.
but here we are, and turns out I kinda like it here. 

something i do know for sure? i love the people. the ones who trust me to dream big, push boundaries, and make magic. the ones who walk into a space and don’t just see it—they feel it.

dear leone is a special place. and i feel pretty damn lucky to call it mine.

— here’s to many more love parties.

special thanks to @specialdaycontent for capturing it all.
